function wppfm_googleProductReviewFeedChanged(feedId,categoryChanged,nameChanged){var productReviewFileNameElement=jQuery("#wppfm-feed-file-name");if(nameChanged&&false===wppfm_validateFileName(productReviewFileNameElement.val())){productReviewFileNameElement.val("")}if(productReviewFileNameElement.val()&&jQuery("#wpprfm-publisher-name").val()){wpprfm_updateFeedFormAfterInputChanged(feedId);wpprfm_showCategoryAndAttributeMappingWrappers();wppfm_enableFeedActionButtons()}else{wpprfm_hideCategoryAndAttributeMappingWrappers();disableFeedActionButtons()}}function wpprfm_productReviewFeedSelected(){var productReviewFileNameElement=jQuery("#wppfm-feed-file-name");if(false===wppfm_validateFileName(productReviewFileNameElement.val())){productReviewFileNameElement.val("")}wpprfm_initializeProductReviewFeedForm(productReviewFileNameElement.val())}